import Card from '../../UI/Card';
import Input from '../../UI/Input';
import Button from '../../UI/Button';
import { Link } from 'react-router-dom';

import styles from './Login.module.css';

const Login = () => {
  return (
    <Card additionalStyles={styles.loginCard} center={true}>
      <Input type='email' label='Email: '></Input>
      <Input type='text' label='Password: '></Input>
      <Button additionalStyles={styles.loginButton}>Login</Button>
      <Link className={styles.registerNow} to='/register'>
        Don't have an account? <br />
        Register now!
      </Link>
    </Card>
  );
};

export default Login;
